import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import { ReactComponent as BackIcon } from '../assets/icons/back.svg';
import { TextField } from '../components/TextField';

export const PostPage = () => {
    const [weather, setWeather] = useState("");
    const [fashionlog, setFashionLog] = useState("");


    return (
        <div>

            <div>
                <Link to=" /mydiary">
                    <button>
                        <BackIcon />
                    </button>
                </Link>
            </div>

            <div className='mt-8 font-lobster text-center text-4xl text-blue-400'>Write Today's Diary</div>


            <div className='font-chakra ml-6 mt-12 text-black text-lg'>Date:</div>


            <div className="border-y border-black mt-4"></div>

            <div className='py-48'></div>

            <div className="border-y border-black mt-4"></div>


            <div>

            <div class>
        <TextField label="Weather" placeholder="How do you feel about Today's Weather?"
          value={weather}
          onChange={(event) => {
            setWeather(event.target.value);

          }} />

        <div className="mb-4"></div>
        <TextField label="Fashion Log" placeholder="Show off your style!"
          value={fashionlog}
          onChange={(event) => {
            setFashionLog(event.target.value);

          }} />
          </div>


                <div className="font-chakra mt-6 ml-6 font-semibold text-xl">Weather</div> <div className="font-chakra text-lg text-center mt-4"></div>
                <div className="border-y border-gray-300 mt-4 mb-4"></div>
                <div className="font-chakra mt-6 ml-6 font-semibold text-xl">Fashion Log</div> <div className="font-chakra text-lg text-center mt-4"></div>
            </div>

            <div className="place-content-center center-justify py-14">
                <Link to="/mydiary">
                    <button>
                        <div className="ml-40 border-2 bg-blue-400 py-4 text-white text-center font-lobster text-lg rounded-full">Create Diary</div>
                    </button>
                </Link>

            </div>




        </div>
    )
}
